                    const result = try buf.readBytes(offset);
                    offset += result.size;
                    res._device = result.value;
                },
                DevicePmCallbackEndFtraceEventWire.DRIVER_WIRE => {
                    const result = try buf.readBytes(offset);
                    offset += result.size;
                    res._driver = result.value;
                },
                DevicePmCallbackEndFtraceEventWire.ERROR_WIRE => {
                    const result = try buf.readInt32(offset);
                    offset += result.size;
                    res._error_ = result.value;
                },
                else => {
                    offset = try buf.skipData(offset, tag.wire);
                },
            }
        }
        return res;
    }
    pub fn sourceBytes(self: *const @This()) []const u8 {
        return self.buf.buf;
    }
    pub inline fn getDevice(self: *const DevicePmCallbackEndFtraceEventReader) []const u8 {
        return self._device orelse &[_]u8{};
    }
    pub inline fn getDriver(self: *const DevicePmCallbackEndFtraceEventReader) []const u8 {
        return self._driver orelse &[_]u8{};
    }
    pub inline fn getError(self: *const DevicePmCallbackEndFtraceEventReader) i32 {
        return self._error_;
    }
};
